@section('scripts')
    <script>
        //Gráfico de barras
        var dataGraf = {!! json_encode($resultGraf) !!};
        const ctx = document.getElementById('myChart');
        new Chart(ctx, {
            type: 'bar',
            data: {
                labels: dataGraf.label,
                datasets: [{
                    label: 'Nivel de gobierno',
                    data: dataGraf.dataSet1,
                    borderWidth: 1,
                }]
            },
            options: {
                responsive: true,
                onHover: (event, chartElement) => {
                    event.native.target.style.cursor = chartElement[0] ? 'pointer' : 'default';
                },
                scales: {
                    y: {
                        beginAtZero: true
                    }
                },
                events: ['mousemove', 'click'],
                onClick: (event, elements, chart) => {
                    if (elements[0]) {
                        let preloader = document.getElementById('preloader');
                        preloader.classList.remove('opacity-0', 'pointer-events-none');
                        const i = elements[0].index;
                        const url = "<?php echo URL::to('detail-government-level'); ?>";
                        const period = "<?php echo $period; ?>";
                        var regionSigla = '';
                        if (chart.data.labels[i] === 'REGIONAL') {
                            regionSigla = 'R';
                        } else if (chart.data.labels[i] === 'LOCAL') {
                            regionSigla = 'L';
                        } else if (chart.data.labels[i] === 'AUTÓNOMO') {
                            regionSigla = 'A';
                        }
                        const finalUrl = url + '/' + regionSigla + '/' + period;
                        window.location.href = finalUrl;
                    }
                }

            },

        });

        // Carrusel de periodos
        (function() {
            var hero = new Splide('#carousel-periodos', {
                classes: {
                    arrows: 'splide__arrows bg-main-green',
                    arrow: 'splide__arrow bg-main-green',

                },
                pagination: false,
                focus: 'center',
                type: 'loop',
                perMove: '1',

                perPage: 6,
                breakpoints: {
                    954: {
                        perPage: 5,
                    },
                    780: {
                        perPage: 4,
                    },
                    640: {
                        perPage: 3,
                    },
                    450: {
                        perPage: 2,
                    },
                },
                autoScroll: {
                    speed: 1.5,
                },
            })

            hero.mount(window.splide.Extensions)
        })();
        // Mapa Peru

        (function() {
            const $mapa = document.getElementById('mapa-peru')
            const $regiones = [...$mapa.querySelectorAll('path')]
            const $tooltip = document.getElementById('tooltip')
            var dataDepartment = {!! json_encode($resultDeparment) !!};


            $regiones.map(region => {
                region.addEventListener('mouseenter', e => {

                    region.setAttribute("fill", "#1B46C2");
                    region.classList.add("cursor-pointer");
                    let top = e.layerY
                    let left = e.layerX
                    let name = region.getAttribute('name');



                    var m_compra = "indefinido";
                    var m_contrato = "indefinido";
                    var c_fra = "indefinido";
                    var m_prc = "indefinido";
                    var m_pmr = "indefinido";
                    var m_crc = "indefinido";
                    var m_adi = "indefinido";
                    var m_cof = "indefinido";
                    var m_fra = "indefinido";
                    var c_dprc = "indefinido";
                    var c_dpmr = "indefinido";
                    var c_dcrc = "indefinido";
                    var c_adi = "indefinido";

                    dataDepartment.forEach((value) => {
                        if (value.departamento === name) {
                            m_compra = parseInt(value.montoordencompra).toLocaleString('en-US');
                            m_contrato = parseInt(value.montocontrato).toLocaleString('en-US');
                            c_fra = parseInt(value.cantidadfra).toLocaleString('en-US');
